import React, { Component, useState } from "react";
import { Link } from "react-router-dom";

export default function Nav() {
  const [toggle, setToggle] = useState(false);

  return (
    <nav>
      <ul>
        <div>
          <button onClick={() => setToggle(true)}>
            {toggle ? "true" : "false"}
          </button>
        </div>
        <Link to="/animation">
          <li>Animation</li>
        </Link>
        <Link to="/film">
          <li>Film</li>
        </Link>
        <Link to="/about">
          <li>About</li>
        </Link>
      </ul>
    </nav>
  );
}
